import React from 'react'
import { StyleSheet, View } from 'react-native'

const Navbar = () => {
  return (
    <View style={Styles.container}>
        kamu sayang aku
    </View>
  )
}

const Styles = StyleSheet.create({
    container : {
        height : 50, 
        backgroundColor : '#448f92'
    }
})

export default Navbar
